window.bookSummaryJSON = "<p><b>Jason has been able to return the Elves of Earth to their brethren on Destiny, and in the process, found out about a battleship on one of Destiny’s moons. </b></p> <p>He wants that ship, but at what cost? But Jason is about to find out that <i>Athena </i>is much more than just a ship. Journey across the Realms as Jason and his friends try to prepare for the battle that is to come. Can he protect both himself and those he feels he needs to protect? </p> <p><i>Contains harem themes, adult language, and some monster girls. </i></p> <p><b>Includes \"Mira's First Christmas\", a bonus story from Sigma Worlds. </b></p>"; 
